export default function Policy() {
    return (
        <div className="w-80 py-4 flex flex-row items-center space-x-6">
            <input className="transform scale-150" type="checkbox" />
            <div>
                <p>
                    Ao clicar você concordar em continuar 
                    e com nossa <span className="text-blue-800">política de produtos</span>
                    </p>
            </div>
      </div>
    )
}
